import { Card } from 'react-bootstrap';
function ContactMe() {
    return (
        <>
            <Card className="text-center mx-5">
                <Card.Body>
                    <Card.Title>Contact Me</Card.Title>
                    <Card.Text>
                    You can reach me at:
                    <input type="email" placeholder="   Your email" />
                    </Card.Text>
                </Card.Body>
            </Card>
        </>
    );
}
export default ContactMe;
